import React, {useState} from 'react';
import {
    MDBBtn,
    MDBContainer,
    MDBCard,
    MDBCardBody,
    MDBCardImage,
    MDBRow,
    MDBCol,
    MDBIcon,
    MDBInput
}
    from 'mdb-react-ui-kit';
import {Field, Form, Formik} from "formik";

function FormRegister() {
    const [merchant, setMerchant] = useState({
        name: '',
        phone: '',
        email: '',
        open_time: '',
        close_time: '',
        address_shop: {
            city: {
                id_city: ''
            },
            district: {
                id_district: ''
            },
            ward: {
                id_ward: ''
            },
            address_detail: ''
        }
    });
    return (
        <MDBContainer className="my-5">

            <MDBCard>
                <MDBRow className='g-0'>

                    <MDBCol md='6'>
                        <MDBCardImage style={{height : '600px'}}
                            src='https://firebasestorage.googleapis.com/v0/b/react-firebase-storage-f6ec9.appspot.com/o/file%2FdoAnNgon.jpg?alt=media&token=e3c3377c-463d-481d-bb04-ba2d890e27b9'
                            alt="register form" className='rounded-start w-100'/>
                    </MDBCol>

                    <MDBCol md='6'>
                        <MDBCardBody className='d-flex flex-column'>

                            <div className='d-flex flex-row mt-2'>
                                <MDBCardImage style={{height : '50px', width: '170px'}} src='https://firebasestorage.googleapis.com/v0/b/react-firebase-storage-f6ec9.appspot.com/o/file%2Flogo--web.png?alt=media&token=372f9a0c-25f3-4f56-9019-21ba8c8e607a'
                                 alt="logo form"/>
                            </div>

                            <h5 className="fw-normal my-4 pb-3" style={{letterSpacing: '1px', fontWeight: 'bolder'}}>Register Merchant</h5>

                                {/*<div style={{width: "500px", margin: 'auto'}}>*/}
                                {/*    <h2 style={{ textAlign: 'center', marginTop: '10px' }}>Register</h2>*/}
                                {/*    <Formik initialValues={} onSubmit={}>*/}
                                {/*        <Form>*/}
                                {/*            <div className="mb-3">*/}
                                {/*                <label className="form-label">Name</label>*/}
                                {/*                <Field className="form-control" name={'name'}></Field>*/}
                                {/*            </div>*/}
                                {/*            <div className="mb-3">*/}
                                {/*                <label className="form-label">Price</label>*/}
                                {/*                <Field className="form-control" name={'price'}></Field>*/}
                                {/*            </div>*/}
                                {/*            <div className="mb-3">*/}
                                {/*                <label className="form-label">Quantity</label>*/}
                                {/*                <Field className="form-control" name={'quantity'}></Field>*/}
                                {/*            </div>*/}
                                {/*        </Form>*/}
                                {/*    </Formik>*/}
                                {/*</div>*/}

                            {/*<MDBInput style={{height : '10px'}} wrapperClass='mb-4' label='Email address' id='formControlLg' type='email' size="lg"/>*/}
                            {/*<MDBInput wrapperClass='mb-4' label='Email address' id='formControlLg' type='email' size="lg"/>*/}
                            {/*<MDBInput wrapperClass='mb-4' label='Email address' id='formControlLg' type='email' size="lg"/>*/}
                            {/*<MDBInput wrapperClass='mb-4' label='Email address' id='formControlLg' type='email' size="lg"/>*/}
                            {/*<MDBInput wrapperClass='mb-4' label='Password' id='formControlLg' type='password' size="lg"/>*/}

                            <MDBBtn className="mb-4 px-5" color='dark' size='lg'>Login</MDBBtn>

                            <div className='d-flex flex-row justify-content-start'>
                                <a href="#!" className="small text-muted me-1">Terms of use.</a>
                                <a href="#!" className="small text-muted">Privacy policy</a>
                            </div>

                        </MDBCardBody>
                    </MDBCol>

                </MDBRow>
            </MDBCard>

        </MDBContainer>
    );
}

export default FormRegister;
